Type.registerNamespace("Fis.Epp.EPaymentsUI.MVC.Views.Zelle");

Fis.Epp.EPaymentsUI.MVC.Views.Zelle.DeviceBridge = function (mockDevice, isSDKEnabled, prototypeMode, enableCordovaPost) {
    this.mockDevice = mockDevice;
    this.prototypeMode = prototypeMode;
    this.Callback = null;
    this.DeviceContactResponse = null;
    this.deviceBridge = new Fis.Epp.EPaymentsUI.DeviceSupport.DeviceBridge(isSDKEnabled, enableCordovaPost);

    if (mockDevice != undefined && mockDevice == "mockDevice") {
        this.deviceBridgeMock = new Fis.Epp.EPaymentsUI.DeviceBridgeMock();
    }
    else {
        this.deviceBridge.setEventProduct(this.deviceBridge.PRODUCT.ZELLE);

        var nativeMessageHandler = function (result) {
            if (result.bridgeMessage.code == this.deviceBridge.MESSAGE_CODE.NAVIGATE_BACK) {
                // Navigate back if not at the beginning of the flow
                var navigated = false;
                var navigationBar = $("div.navigation-bar");
                var backNavigation = $(".link.backArrow", navigationBar);
                if (backNavigation.length == 1 && $(backNavigation).is(':visible')) {
                    backNavigation.click();
                    navigated = true;
                    return;
                }

                if (!navigated) {
                    var cancelNavigation = $("div.rightNavigationSection a.CancelLink", navigationBar);
                    if (cancelNavigation.length == 1 && $(cancelNavigation).is(':visible')) {
                        cancelNavigation.click();
                        navigated = true;
                        return;
                    }
                }

                // If at the beginning of the flow raise a back button event
                if (!navigated) {
                    this.deviceBridge.raiseEvent(this, null, "BackEvent", this.deviceBridge.EVENT_TYPE.BACK_BUTTON, null);
                }
            }
        };
        this.deviceBridge.registerNativeMessageHandler(this, nativeMessageHandler);
    }
    this.Locked = false;
};

Fis.Epp.EPaymentsUI.MVC.Views.Zelle.DeviceBridge.prototype = {

    _getContacts: function () {
        this.Locked = true;
        var self = this;
        if (this.prototypeMode != undefined && this.prototypeMode == "prototypeMode") {
            setTimeout(function () {
                Fis.Epp.EPaymentsUI.MVC.Views.Zelle.DeviceBridge.GetProtoTypeContacts(onReceiveContacts, {});
            }, 2000);

            return true;
        }
        else if (this.mockDevice != undefined && this.mockDevice == "mockDevice") {
            var mockDeviceBridge = this.deviceBridgeMock;
            setTimeout(function () {
                mockDeviceBridge.getContacts(onReceiveContacts, {});
            }, 2000);

            return true;
        }
        else {
            if (self.DeviceContactResponse == null) {
                return this.deviceBridge.getContacts(this, onReceiveContacts, {});
            }
            else {
                self.Locked = false;
                self.CallBack(self.DeviceContactResponse);
            }
        }
        function onReceiveContacts(jsonResponse) {
            self.Locked = false;
            if (jsonResponse != null) {
                self.DeviceContactResponse = jsonResponse;
                self.CallBack(self.DeviceContactResponse);
            }
        };
    },

    getCapabilities: function () {
        if (this.mockDevice != undefined && this.mockDevice == "mockDevice") {
            var mockDeviceBridge = this.deviceBridgeMock;
            return mockDeviceBridge.getCapabilities();
        }
        else {
            var platform = this.deviceBridge.getPlatform();
            return {
                "platform": platform,
                "isContactInfoAvailable": platform === null,
                "isImageCaptureAvailable": platform === null,
                "isEventNotificationAvailable": platform === null
            };
        }
    },

    getPlatforms: function () {
        // Ensure platforms always come from the actual bridge
        var bridge;
        if (this.mockDevice != undefined && this.mockDevice == "mockDevice") {
            bridge = new Fis.Epp.EPaymentsUI.DeviceSupport.DeviceBridge(false);
        }
        else {
            bridge = this.deviceBridge;
        }
        return bridge.PLATFORMS;
    },

    GetContacts: function (callBack) {
        this.CallBack = callBack;
        if (this.Locked) { }
        else {
            return this._getContacts();
        }
    },
    GetMetadata: function () {
        return this.deviceBridge.getMetadata();
    },

    pickContact: function (object, callback, options) {
        return this.deviceBridge.pickContact(object, callback, options);
    },

    sendSMS: function (object, callback, options) {
        if (this.mockDevice != undefined && this.mockDevice == "mockDevice") {
            var mockDeviceBridge = this.deviceBridgeMock;
            setTimeout(function () {
                mockDeviceBridge.sendSMS(object, callback, options);
            }, 2000);
        }
    },

    sendEmail: function (object, callback, options) {
        if (this.mockDevice != undefined && this.mockDevice == "mockDevice") {
            var mockDeviceBridge = this.deviceBridgeMock;
            setTimeout(function () {
                mockDeviceBridge.sendEmail(object, callback, options);
            }, 2000);
        }
    },

    selectImage: function (object, callback, options) {
        if (this.mockDevice != undefined && this.mockDevice == "mockDevice") {
            var mockDeviceBridge = this.deviceBridgeMock;
            setTimeout(function () {
                mockDeviceBridge.selectImage(object, callback, options);
            }, 2000);
        }
    },

    raiseStartedEvent: function (object, callback, eventId, options) {
        if (this.mockDevice != undefined && this.mockDevice == "mockDevice") {
            var mockDeviceBridge = this.deviceBridgeMock;
            setTimeout(function () {
                mockDeviceBridge.raiseStartedEvent(object, callback, eventId, options);
            }, 2000);
        }
        else {
            this.deviceBridge.raiseEvent(object, callback, eventId, this.deviceBridge.EVENT_TYPE.STARTED, options);
        }
    },
    raiseCompletedEvent: function (object, callback, eventId, options) {
        if (this.mockDevice != undefined && this.mockDevice == "mockDevice") {
            var mockDeviceBridge = this.deviceBridgeMock;
            setTimeout(function () {
                mockDeviceBridge.raiseCompletedEvent(object, callback, eventId, options);
            }, 2000);
        }
        else {
            this.deviceBridge.raiseEvent(object, callback, eventId, this.deviceBridge.EVENT_TYPE.COMPLETED, options);
        }
    },
    raiseErrorEvent: function (object, callback, eventId, options) {
        if (this.mockDevice != undefined && this.mockDevice == "mockDevice") {
            var mockDeviceBridge = this.deviceBridgeMock;
            setTimeout(function () {
                mockDeviceBridge.raiseErrorEvent(object, callback, eventId, options);
            }, 2000);
        }
        else {
            this.deviceBridge.raiseEvent(object, callback, eventId, this.deviceBridge.EVENT_TYPE.ERROR, options);
        }
    },
    raiseEvent: function (object, callback, eventId, eventType, options) {
        if (this.mockDevice != undefined && this.mockDevice == "mockDevice") {
            var mockDeviceBridge = this.deviceBridgeMock;
            setTimeout(function () {
                mockDeviceBridge.raiseEvent(object, callback, eventId, options);
            }, 2000);
        }
        else {
            this.deviceBridge.raiseEvent(object, callback, eventId, eventType, options);
        }
    }

};

